import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/'></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
